export default function Appointment(props) {

  return (
    <article className="appointment">
      <Header time = {props.time} />

      props.interview ?  <Show
          student={props.student}
          interviewer={props.interviewer}
          onDelete={onDelete}
          onEdit={onEdit}
        /> : <Empty />
    </article> 
  )
}
